import React from "react";
import logo from "../assets/logo.png";
import "./Navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Zottry Logo" />
      </div>
      <ul className="navbar-links">
        <li><a href="/">Home</a></li>
        <li><a href="/all-lotteries">All lotteries</a></li>
        <li><a href="/lottery-results">Lottery Results</a></li>
        <li><a href="/my-offers">My offers</a></li>
        <li><a href="/promotions">promotions</a></li>
        <li><button className="wallet-btn">Login / Register</button></li>
      </ul>
    </nav>
  );
}

export default Navbar;
